    <script>
        scroll(0,0);    // goto page top

        function copyToClipboardFix(textToCopy) {
            // navigator clipboard api needs a secure context (https)
            if (navigator.clipboard && window.isSecureContext) {
                // navigator clipboard api method'
                return navigator.clipboard.writeText(textToCopy);
            } else {
                // text area method
                let textArea = document.createElement("textarea");
                textArea.value = textToCopy;
                // make the textarea out of viewport
                textArea.style.position = "fixed";
                textArea.style.left = "-999999px";
                textArea.style.top = "-999999px";
                document.body.appendChild(textArea);
                textArea.focus();
                textArea.select();
                return new Promise((res, rej) => {
                    // here the magic happens
                    document.execCommand('copy') ? res() : rej();
                    textArea.remove();
                });
            }
        }

        function copyToClipboard(elementID) {
            var element = document.getElementById(elementID);

            if (element instanceof HTMLTextAreaElement) {
                element.setSelectionRange(0, 99999);                // mobile devices
                //navigator.clipboard.writeText(element.value);       // copy
                copyToClipboardFix(element.value);
                alert("Copied:\r\n" + element.value);
            } 
            else if (element instanceof HTMLDivElement || element instanceof HTMLParagraphElement) {
                //navigator.clipboard.writeText(element.innerHTML);   // copy
                copyToClipboardFix(element.innerHTML);
                alert("Copied:\r\n" + element.innerHTML);
            }
            else {
                alert("Error. Define Copy Element.");
            }   
        }
    </script>

    <script type="text/javascript">

        var wallet = null;
        var bundle = require('index');

        function showPasswordDialog(messageText) {
            var width  = window.innerWidth / 2;
            var height = width * 0.5; // window.innerHeight /2;
                if (height<200) { height = 200; }

            var pwprompt = document.createElement("div"); //creates the div to be used as a prompt
                pwprompt.id = "password_prompt";
                const posleft = ((window.innerWidth  / 2) - (width  / 2)) + "px"; 
                
                //y-center, good on desktop bad on phone: const postop  = ((window.innerHeight / 2) - (height / 2)) + "px";
                const postop  = "5%"; // draw in upper part

                pwprompt.style.cssText += 'position:fixed; left:'+posleft+'; top:'+postop+'; border:5px solid #242b45; padding:16px; background-color: #3b4b83; padding: 10px; z-index:99999; ';
                pwprompt.style.cssText += 'width:'+ width +'; height:'+ height +'; opacity:100%';
                pwprompt.style.borderRadius = '25px';

            var pwtext = document.createElement("div"); // create the div for the password-text
                pwtext.innerHTML = messageText;         // 'ENTER PASSWORD'
                pwtext.style.cssText += "; height:30%; font-size:40; font-weight:bold; color: white; text-align: center; ";
                pwprompt.appendChild(pwtext);           // append the text-div to the password-prompt
            
            var pwinput = document.createElement("input"); //creates the password-input
                pwinput.id = "password_id"; //give it some id - not really used in this example...
                pwinput.type="password"; // makes the input of type password to not show plain-text
                pwinput.style.cssText += "; width:100%; height:30%; font-size:30; background-color: #336; color: white; text-align: center;";
                pwprompt.appendChild(pwinput);
                

            pwprompt.appendChild( document.createElement("br") );   // buttons in New Line
            pwprompt.appendChild( document.createElement("br") );   // buttons in New Line

            var buttonOk = document.createElement("button");  buttonOk.innerHTML = "OK";      pwprompt.appendChild(buttonOk);
            buttonOk.style.cssText += "; width:50%; height:30%; font-size: 60px; ";
            var buttonCl = document.createElement("button");  buttonCl.innerHTML = "Cancel";  pwprompt.appendChild(buttonCl);
            buttonCl.style.cssText += "; width:50%; height:30%; font-size: 60px; ";

            // overlay for whole area (gray out)
            var backOverlayDiv = document.createElement("div");
            backOverlayDiv.style.cssText += ';position:fixed; top:0px; left:0px; width:'+width*2+'px; height:'+height*2+'px; opacity:75%; background:black; z-index:9999; ';

            document.body.appendChild(backOverlayDiv);
            document.body.appendChild(pwprompt);
            pwinput.focus();

            // create and return a promise
            return new Promise(function(resolve, reject) {
                pwprompt.addEventListener('click', function handleButtonClicks(e) { 
                    if (e.target.tagName !== 'BUTTON') { return; } //nothing to do - user clicked somewhere else
                    pwprompt.removeEventListener('click', handleButtonClicks); //removes eventhandler on cancel or ok
                    if (e.target === buttonOk) { //click on ok-button
                        resolve(pwinput.value);  //return the value of the password
                    } else {
                        reject(new Error('PW-Dialog cancelled'));
                    }
                    document.body.removeChild(backOverlayDiv);
                    document.body.removeChild(pwprompt);
                });
                pwinput.addEventListener('keyup',function handleEnter(e){ //users dont like to click on buttons
                    if (e.keyCode==13 || e.keyCode==27) {
                        if (e.keyCode==13) {
                            resolve(pwinput.value);                   //return password
                        } else {
                            reject(new Error("PW-Dialog cancelled")); //return error
                        }
                        document.body.removeChild(backOverlayDiv);    //hide Dialog
                        document.body.removeChild(pwprompt);
                    }
                });
            }); 
        }
        
        async function readSingleFile(evt) {

            var file = evt.target.files[0]; 
            if (file) {
                var reader = new FileReader();
                reader.onload = async function(e) {
                    // read Wallet
                    var content = e.target.result;
                    document.getElementById("walletEncryptedJson").value = content;
                }
                reader.readAsText(file);
            } else { 
                alert("Error loading Wallet File");
            }
        }
        document.getElementById('getFile').addEventListener('change', readSingleFile, false);
    </script>

        <script>
            async function buttonSignAndCreateRawTransaction() {

                    await QRCode.toCanvas( document.getElementById('canvasRAW'), raw, { errorCorrectionLevel: 'H' }, function (error) {

                    });

                    document.getElementById("infoRAWTransaction").style.display = 'block';       // show RAW Transaction
                } catch (error) {
